INSERT INTO `FAQ` (`Head`, `Body`) VALUES ('Â¿Que es AcciÃ³nSocialMed?','AcciÃ³nSocialMed es una plataforma que tiene como objetivo relacionar a los estudiantes de la universidad de mÃ¡laga con distintas organizaciones con el fin de tener una ex periencia de aprendizaje mÃ¡s completa. Puedes averiguar mÃ¡s pulsando el botÃ³n \"Sobre nosotros\" en la parte superior de la pÃ¡gina.'),('Â¿Como puedo Iniciar SesiÃ³n?','Para iniciar sesiÃ³n es necesario tener una cuenta institucional de la universidad de MÃ¡laga, ya sea como alumno o como PAS/PDI.\r\n\r\nPara entrar como organizaciÃ³n es necesario tener credenciales otorgados por los administradores de esta plataforma. Para adquirirlos, o en caso de problemas, dirÃ­jase a la secciÃ³n \"Contacto\" en el menÃº de la izquierda de esta pÃ¡gina.'),('Â¿Que informaciÃ³n se guarda sobre mi?','En AccionSocialMed tus datos son gestionados por la Universidad de MÃ¡laga, bajo el reglamento general de protecciÃ³n de datos.'),('Â¿CÃ³mo puedo inscribirme en una actividad?','Una vez hayas iniciado sesiÃ³n puedes ver un listado de actividades propuestas por diferentes organizaciones y ademÃ¡s enviar una solicitud. Si eres elegido la plataforma te enviarÃ¡ un correo electrÃ³nico con la confirmaciÃ³n.</br>\r\n\r\nSi ademÃ¡s eres estudiante de la UMA puedes optar a actividades que se tienen en cuenta en tu expediente acadÃ©mico.'),('Â¿Puedo obtener recomendaciones personalizadas?','La plataforma dispone de un sistema que te muestra actividades acordes a tus preferencias. <br>\r\n\r\nPuedes acceder a Ã©l pulsando el botÃ³n \"Ver recomendadas\" en el catÃ¡logo de actividades.'),('Â¿Puedo Valorar una actividad que haya realizado?','Una vez haya pasado la fecha de finalizaciÃ³n de una actividad, si has participado en ella aparecerÃ¡ en la secciÃ³n \"Actividades Completadas\". AllÃ­ podrÃ¡s dar una nota entre 1 y 5 estrellas. <br>\r\n\r\nUna vez hayas valorado la actividad, la plataforma te mostrÃ¡ra la valoraciÃ³n que haya hecho sobre ti la organizaciÃ³n, y te permitirÃ¡ descargar un certificado de participaciÃ³n.'),('Soy un profesor, Â¿Como puedo hacer un seguimiento de las actividades relacionadas con mis asignaturas?','En la seccion \"Mis Asignaturas\" aparecerÃ¡n todas las actividades que un gestor haya decidido asignar a una de las asignaturas que imparte. <br>\r\n\r\nEn esta secciÃ³n podrÃ¡ ademÃ¡s gestionar las solicitudes de sus alumnos a dichas actividades.');
